  false,\n\t\"url\": null,\n\t\"notes\": \"Fugro EarthData, Inc. (Fugro) was tasked
  by the U.S. Geological Survey (USGS) to plan, acquire, process, and produce derivative
  products of LiDAR data at a nominal pulse spacing (NPS) of 0.7 meters based on the
  \"U.S. Geological Survey National Geospatial Program LiDAR Base Specification Version
  1.0\". The project area consists of approximately 1,917 square miles and covers
  York and Lancaster Counties, Pennsylvania. Fugro's approved ID/IQ subcontractor
  Richard Crouse & Associates, Inc. (RC&A) acquired 148 flight lines in 11 lifts between
  November 25 and December 27, 2014. LiDAR data collection was performed with a twin
  engine aircraft, utilizing a Riegl Q-680i sensor; collecting multiple return x,
  y, and z as well as intensity data. Specialized in-house and commercial software
  processes the native LiDAR data into 3-dimensional positions that can be imported
  into GIS software for visualization and further analysis. Breaklines were delivered
  with the lidar dataset. These have not been reviewed by NOAA OCM, therefore are
  only available by request.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
